import React, { Component } from 'react';
import { Card, Paper, Typography } from '@material-ui/core';

export default class Ratingsandreviews extends Component {
    render() {
        return (
            <div className="Ratingsandreviews">
                <div className="Ratingsandreviews__wrapper">
                    <div className="Ratingsandreviews__wrapper_left">
                        <Card className="Ratingsandreviews__wrapper_left_heading">
                            <Typography gutterBottom variant="h5" component="h2">
                            Ratings and Reviews
                            </Typography>
                            <div>
                                <p>Overview <span>4.5</span> | 124 Total Ratings</p>
                            </div>
                        </Card>
                    </div>
                </div>
            </div>
        )
    }
}
